import { useState, useEffect } from "react";
import { Link } from "react-router-dom";

export default function Vans() {
  const [vans, setVans] = useState([]);
  useEffect(() => {
    const getVans = async () => {
      const res = await fetch('api/vans')
      const data = await res.json();
      setVans(data.vans);
    }
    getVans();
  }, []);

  const vanComponents = vans.map(van => {
    return (
      <div key={van.id} className="van-container">
          <Link to='/vans/:id' className="van-link">
            <img src={van.imageUrl} alt="van avatar" />
          <h3 className="van-name">{van.name}</h3>
          <p className="van-price">${van.price}/day</p>
          <i className="van-type">{van.type}</i>
          </Link>
      </div>
    )
  });

  return (
    vanComponents
  );
};
